import React from 'react';

const SystemDesign = () => {
  return (
    <div className="container mt-4">
      <h2>System Design</h2>
      <div className="card">
        <div className="card-body">
          <h5 className="card-title">System Design Concepts</h5>
          <ul className="list-group list-group-flush">
            <li className="list-group-item">Scalability</li>
            <li className="list-group-item">Load Balancing</li>
            <li className="list-group-item">Caching</li>
            <li className="list-group-item">Database Sharding</li>
            <li className="list-group-item">Microservices Architecture</li>
            <li className="list-group-item">API Design</li>
          </ul>
        </div>
      </div>
    </div>
  );
};

export default SystemDesign;
